{"query":"query transactions($skip: Int, $take: Int) {
  transactions(skip: $skip, take: $take) {
    id
    transactionType
    resourceType
    input{
      entity {
        id
        type
        created
        identities{
          id
          status
          fingerprint
        }
      }
    }
    output{
      entity {
        id
        type
        created
        identities{
          id
          status
          fingerprint
        }
      }
    } 
